<div class="entities" style="line-height: 2.5; direction: ltr">[ Transport of mucoid mucus in healthy individuals and patients with chronic obstructive pulmonary disease and bronchiectasis ] . OBJECTIVE : To characterise and compare the in vitro transport properties of respiratory mucoid secretion in individuals with no lung disease and in stable patients with chronic obstructive pulmonary disease ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and bronchiectasis . METHODOLOGY : Samples of mucus were collected , from 21 volunteers presenting no lung disease who had undergone surgery , from 10 patients presenting chronic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and from 16 patients with bronchiectasis . Mucociliary transport ( Q8IVS2 ) , transport by cough ( DB00919 ) , and contact angle ( P62158 ) were evaluated . RESULTS : Q8IVS2 was found to be greater in healthy individuals ( 1.0  0.19 ) than in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( 0.91  0.17 ) and bronchiectasis ( 0.76  0.23 ) patients ( p &lt; 0.05 ) , whereas DB00919 was greater in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 patients ( 16.31  7.35 cm ) than in patients with bronchiectasis ( 12.16  6.64 cm ) and healthy individuals ( 10.50  25.8 cm ) ( p &lt; 0.05 ) . No significant differences were observed between the groups regarding P62158 . CONCLUSION : Mucus from healthy individuals allows better mucociliary transport compared to that from patients with lung diseases . However , the mucus from 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 patients allows a better transport by coughing , demonstrating that these individuals have adapted to a defence mechanism compared to patients with bronchiectasis , who have impairment in their ciliary and cough transport mechanisms .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08246
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitors as treatment for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . Chronic obstructive pulmonary disease , characterised by a slowly progressive , irreversible airways limitation , is a major worldwide cause of chronic morbidity and mortality . The imbalance between human neutrophil elastase and endogenous antiproteases may cause excess human neutrophil elastase in pulmonary tissues , which may be considered a major pathogenic factor in chronic obstructive pulmonary disease . Great effort has been devoted to finding a method to restore the balance , resulting in the discovery of potent two-typed small-molecular-weight human neutrophil elastase inhibitors . In the application of chronic obstructive pulmonary disease therapy , the human neutrophil elastase inhibitors mainly focused upon include ONO - 5046 , MR - 889 , L -694,458 , CE - 1037 , GW - 311616 and TEI - 8362 as the acyl-enzyme inhibitors ; and

 , AE - 3763 , FK - 706 , ICI -200,880 , ZD - 0892 and ZD - 8321 as the transition-state inhibitors . In this review , various problems that remain to be solved in the clinical use of human neutrophil elastase inhibitors are discussed .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Modulation of cytokine production and enhancement of cell viability by Q9NYK1 and Q9NR96 ligands during anthrax infection of macrophages . Inhalation of Bacillus anthracis , a bioterrorism agent , results in a high mortality rate despite appropriate antibiotic therapy . Macrophages appear to be a key factor in B . anthracis pathogenesis . The burst of pro-inflammatory cytokines from macrophages could be a major cause of death in anthrax . However , preactivation of Toll-like receptors ( TLRs ) could modify the host response . TLR ligands stimulate the release of activating cytokines but may also down-modulate the subsequent deleterious cytokine response to pathogens . We developed a cell culture model to measure macrophage responses to B . anthracis spores and bacilli . We found that germination from spores to bacilli produced a substantial stimulus for the secretion of the cytokines 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ,

 ,

 , and IL - 12 p40 . Our studies showed that pretreatment of mouse macrophages with the Q9NR96 ligand 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and

 in response to B . anthracis infection of macrophages . Furthermore , the Q9NYK1 and Q9NR96 ligands significantly decreased anthrax-induced cytotoxicity in the macrophages . These findings suggest that TLR ligands may contribute to the enhancement of innate immunity in B . anthracis infection by suppressing potentially deleterious pro-inflammatory cytokine responses and by improving macrophage viability .</div>

 substances are available for routine clinical use , ie , pegaptanib , ranibizumab , and bevacizumab . The aim of this review is to summarize the evidence supporting the use of ranibizumab in clinical practice . Most of the studies analyzed in this review are prospective , controlled clinical trials that have focused on documenting the therapeutic effect of ranibizumab and its safety , providing encouraging results .</div>

 ] and antagonistic action at others ( especially 5 -

 ) . Clinical trials indicate that aripiprazole is effective in treating the positive and negative symptoms of schizophrenia . In short-term studies rapid onset of action ( within one week ) has been demonstrated . Preliminary data indicate that aripiprazole may also be effective in the treatment of manic symptoms of bipolar disorder . At recommended doses , aripiprazole appears to be safe and well tolerated in most adult patients with schizophrenia and schizoaffective disorder . There is only limited information available on the use of aripiprazole in children and adolescents , and pilot data suggest that a revised dosing strategy , based on weight , is indicated in this population . In the long-term studies , the use of aripiprazole was associated with continued efficacy , good compliance and increased time-to-relapse . Aripiprazole represents the first functionally selective atypical antipsychotic drug .</div>
